const tables = {}; // Store multiple table instances

$(document).ready(function() {
    tables.recordTable = createTable('#recordTable', '/api_db/records', recordsColumns);
    tables.baptismTable = createTable('#baptismTable', '/api_db/baptism', baptismColumns);
    tables.confirmationTable = createTable('#confirmationTable', '/api_db/confirmation', confirmationColumns);
    tables.weddingTable = createTable('#weddingTable', '/api_db/wedding', weddingColumns);
    tables.deathTable = createTable('#deathTable', '/api_db/death', deathColumns);
    tables.priestTable = createTable('#priestTable', '/api_db/priest', priestColumns);
    tables.requestTableStaff = createTable('#requestTableStaff', '/api_db/get-request', requestColumns);
    tables.accountTable = createTable('#accountTable', '/api_db/account', accountColumns);
    tables.requestTable = createTable('#requestTable', '/api_db/request-client', reqClientColumns);
    tables.auditLogTable = $('#auditLogTable').DataTable({
        ajax: '/api_db/audit-logs',
        columns: [
            {
                data: 'changed_at',
                render: function (data, type, row) {
                    if (type === 'display' || type === 'filter') {
                        return formatDateTimeLong(data);
                    }
                    return data; // Use ISO string for sorting
                }
            },
            { data: 'action' },
            { data: 'table_name' },
            { data: 'record_id' },
            {
                data: null, // Use `null` since we're combining multiple fields
                render: function (data, type, row) {
                    let output = `Username: ${row.changed_by || 'N/A'}<br>`;
                    if (row.changed_by_info && typeof row.changed_by_info === 'object') {
                        for (const [key, value] of Object.entries(row.changed_by_info)) {
                            const label = key.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
                            const formattedValue = (key === 'email')
                                ? `<small>${value ?? ''}</small>`
                                : `${value ?? ''}`;
                            output += `${label}: ${formattedValue}<br>`;
                        }
                    }
                    return `<div class="json-cell">${output}</div>`;
                }
            },
            {
                data: 'old_data',
                render: function (data) {
                    return formatJsonCell(data);
                }
            },
            {
                data: 'new_data',
                render: function (data) {
                    return formatJsonCell(data);
                }
            }
        ],
        // dom: 'Bfrtip',
        // buttons: ['copy', 'excel', 'pdf', 'print'],
        // scrollX: true,
        // pageLength: 10,
        autoWidth: false,
        columnDefs: [
            { width: '160px', targets: 0 },  // changed_at
            { width: '100px', targets: 1 },  // action
            { width: '100px', targets: 2 },  // table_name
            { width: '80px',  targets: 3 },  // record_id
            { width: '120px', targets: 4 },  // changed_by
            { width: '300px', targets: 5 },  // old_data
            { width: '300px', targets: 6 },  // new_data
        ],
        paging: true,
        searching: true,
        ordering: true,
        order: [[0, 'desc']]
    });


    
    // ðŸ”— Handle PDF Button
    document.querySelectorAll('.btn-pdf').forEach(button => {
        button.addEventListener('click', function () {
            const tableId = this.getAttribute('data-table');
            const fileName = this.getAttribute('data-table-name') || 'Table';
            const dataTable = tables[tableId];

            if (tableId && dataTable) {
                exportAllVisibleTableToPDF(tableId, dataTable, fileName);
            } else {
                console.error('Missing table or DataTable instance');
            }
        });
    });

});

const logoBase64 = 'data:image/png;base64,';  // Use actual Base64 string here

function exportAllVisibleTableToPDF(tableId, dataTable, fileName, base64Image) {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF('landscape');

    // Temporarily show all rows
    dataTable.page.len(-1).draw();

    // Clone the full table with all rows visible
    const tableClone = document.getElementById(tableId).cloneNode(true);

    // Restore pagination
    dataTable.page.len(10).draw(); // Reset to default page size

    // Remove the Action column
    const headers = tableClone.querySelectorAll('thead tr');
    const bodyRows = tableClone.querySelectorAll('tbody tr');

    let actionColIndex = -1;
    headers.forEach(row => {
        row.querySelectorAll('th').forEach((th, i) => {
            if (th.innerText.toLowerCase() === 'action') {
                actionColIndex = i;
                th.remove();
            }
        });
    });

    bodyRows.forEach(row => {
        const cells = row.querySelectorAll('td');
        if (actionColIndex >= 0 && cells[actionColIndex]) {
            cells[actionColIndex].remove();
        }
    });

    // Add a new <th> as first column header
    headers.forEach(row => {
        const th = document.createElement('th');
        th.textContent = '#';
        row.insertBefore(th, row.firstChild);
    });

    // Add <td> with row numbers
    bodyRows.forEach((row, index) => {
        const td = document.createElement('td');
        td.textContent = index + 1;
        row.insertBefore(td, row.firstChild);
    });
    // Add left-aligned image and text
    const imageX = 10;
    const imageY = 10;
    const imageWidth = 15;
    const imageHeight = 15;
    doc.addImage(logoBase64, 'PNG', imageX, imageY, imageWidth, imageHeight);

    // Add text aligned next to image
    const textX = imageX + imageWidth +1; // small space between image and text
    const textY = imageY + 7;              // vertically aligned with image center

    doc.setFontSize(12);
    doc.setFont(undefined, 'bold');
    doc.text('St. Joseph Parish', textX, textY);

    doc.setFontSize(10);
    doc.setFont(undefined, 'italic');
    doc.text(`${fileName} Record`, textX, textY + 5);

    // Replace all dropdowns with selected option text before exporting
    tableClone.querySelectorAll('select').forEach(select => {
        const td = select.closest('td');
        if (td) {
            td.textContent = select.options[select.selectedIndex]?.text || '';
        }
    });

    // Draw table below header
    doc.autoTable({
        html: tableClone,
        startY: imageY + imageHeight + 5, // space after header section
        theme: 'grid',
        headStyles: {
            fillColor: [169, 169, 169],
            textColor: [0, 0, 0],
            lineWidth: 0.3,
            lineColor: [0, 0, 0],
            halign: 'center',
            valign: 'middle'
        },
        styles: {
            lineWidth: 0.3,
            lineColor: [0, 0, 0],
            halign: 'left',
            valign: 'middle'
        },
        showHead: 'everyPage'
    });

    // Save PDF
    doc.save(`${fileName}.pdf`);
}


// Function to format date to YYYY-MM-DD
function formatDate(dateString) {
    const date = new Date(dateString);
    const year = date.getFullYear();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    return `${year}-${month}-${day}`;
} 

// Function to format date to "MM/DD/YYYY"
function formatDateToMMDDYYYY(dateString) {
    const date = new Date(dateString);
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const year = date.getFullYear();
    return `${month}/${day}/${year}`;
}

//function to format date to "yyyy-mm-dd"
function formatFormDate(dateString) {
    let date = new Date(dateString);
    let year = date.getFullYear();
    let month = String(date.getMonth() + 1).padStart(2, "0"); 
    let day = String(date.getDate()).padStart(2, "0"); 
    return `${year}-${month}-${day}`;
}

// Function to format date to "Month DD, YYYY"
function formatDateToLong(dateString) {
    const date = new Date(dateString);
    const options = { year: 'numeric', month: 'long', day: 'numeric' };
    return date.toLocaleDateString('en-US', options);
}

// Function to format date to "Month DD, YYYY"
function formatDateTimeLong(dateString) {
    const date = new Date(dateString);
    const options = { year: 'numeric', month: 'long', day: 'numeric' };
    return date.toLocaleDateString('en-US', options);
}

function formatDateTimeLong(dateString) {
    const date = new Date(dateString);
    const options = {
        year: 'numeric',
        month: 'long',
        day: 'numeric',
        hour: 'numeric',
        minute: '2-digit',
        hour12: true
    };
    return date.toLocaleString('en-US', options);
}

function calculateAge(birthday) {
    let birthDate = new Date(birthday);
    let today = new Date();

    let age = today.getFullYear() - birthDate.getFullYear();

    let monthDiff = today.getMonth() - birthDate.getMonth();
    let dayDiff = today.getDate() - birthDate.getDate();

    if (monthDiff < 0 || (monthDiff === 0 && dayDiff < 0)) {
        age--;
    }
    return age;
}

function formatJsonCell(data) {
    if (!data) return 'N/A';

    function formatDateTime(value) {
        if (!value) return '';
        const date = new Date(value);
        if (isNaN(date)) return value; // return original if not a valid date
        return date.toLocaleString('en-PH', {
            year: 'numeric',
            month: 'short',
            day: '2-digit',
            hour: '2-digit',
            minute: '2-digit',
            hour12: true,
            timeZone: 'Asia/Manila',
        });
    }

    const skipFields = ['date_created', 'updated_at', 'id'];
    let output = '';

    for (const [key, value] of Object.entries(data)) {
        if (skipFields.includes(key.toLowerCase())) {
            continue; // skip these fields
        }

        if (key.toLowerCase().includes('date') || key.toLowerCase().includes('time')) {
            output += `<strong>${key}:</strong> ${formatDateTime(value)}<br>`;
        } else {
            output += `<strong>${key}:</strong> ${value ?? ''}<br>`;
        }
    }
    return `<div class="json-cell">${output}</div>`;
}



function formatKeyValueDisplay(data) {
    if (!data || typeof data !== 'object') return 'N/A';

    return Object.entries(data).map(([key, value]) => {
        const label = key.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase());
        return `${label}: ${value ?? ''}`;
    }).join('<br>');
}


window.formatDate = formatDate;
window.formatDateToLong = formatDateToLong;
window.formatFormDate = formatFormDate;
window.formatDateTimeLong = formatDateTimeLong;
